        var tableBody = document.getElementById("data-table-body");
        var filterInput = document.getElementById("filter-input");

        // Function to filter the table based on the given criteria
        function filterTable() {
            var filterValue = filterInput.value.toUpperCase();
            
            for (var i = 0; i < jsonData.length; i++) {
                var symbol = jsonData[i]["SYMBOL"].toUpperCase();
                
                if (symbol.includes(filterValue)) {
                    tableBody.rows[i].style.display = "";
                } else {
                    tableBody.rows[i].style.display = "none";
                }
            }
        }

        // Initial table population
        for (var i = 0; i < jsonData.length; i++) {
            var row = tableBody.insertRow(i);

            var keys = Object.keys(jsonData[i]);
            for (var j = 0; j < keys.length; j++) {
                var cell = row.insertCell(j);
                cell.innerHTML = jsonData[i][keys[j]];
            }
        }

        // Event listener for input changes
        filterInput.addEventListener("keyup", filterTable);
    </script>
